   Row,
   Col,
   Input,
   Form,
   FormGroup,
   Button,
   Label,
   Card,
   CardBody,
   CardFooter
} from "reactstrap";


class Password extends Component{

    state = {
        isChecked: true,
        pass:'',
        redirect: false,
        uuid:'',
        user_id:'',
        c_data:''
     };

     emailChange = e =>{
        this.setState({email:e.target.value})
      }
      
    render(){
        return (
            <text>はつゆきさくら</text>
        )
    }
}

export default Password
